import { useEffect, useState } from "react";

function Results() {
    const [data, setData] = useState([{}])

    useEffect(() => {
        fetch("/members").then(
            res => res.json()
        ).then(
            data => {
                setData(data)
                console.log(data)
            }
        )
    }, [])
    
    return(
        <div className="App" id="results">
            {(typeof data.members == "undefined") ? (
                <p>loading ...</p>
            ) : (
                data.members.map((member, i) => (
                    <p key={i}>{member}</p>
                ))
            )}
        </div>
    );
}

export default Results;
